import React from 'react'

export default function Table({url}) {
  return (
                            <tr scope="row"> 
                             
                                <td >
                                <a href={url.full}>{url.full}</a>
                                </td>
                                <td><a onClick={shorturlHandler(url.short)} href={url.short}>{url.short}</a></td>
                                <td>{url.clicks}</td>
                            
                            </tr>
  )
}
